import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';

const FormUpper = () => {
  return (
    <form className="text-center" >
      <div className="form-group">
        <input type="text" className="form-control mt-4" id="textMinus" placeholder="hola"/>
      </div>
      <button type="submit" className="btn btn-primary">MAYUS</button>
    </form>
  );
}
export default FormUpper;
